%% getSettings Gets the settings for the autograder
%
%   settings = getSettings()
%
%   Input:
%       NONE
%
%   Output:
%       settings (struct)
%           - a struct containing the settings for the autograder
%
%   Description:
%       Returns a struct containing the settings for the autograder
function settings = getSettings()
    settings.fileNames.RUBRIC_JSON_SUBMISSION = 'rubrica.json';
    settings.fileNames.RUBRIC_JSON_RESUBMISSION = 'rubricb.json';
    settings.fileNames.FEEDBACK = 'feedback.html';
    settings.fileNames.GRADES_CSV = 'grades.csv';

    settings.folderNames.RUBRIC_GRADER = 'grader';
    settings.folderNames.RUBRIC_STUDENT = 'student';
    settings.folderNames.SOLUTIONS = 'Solutions';
    settings.folderNames.SUPPORTING_FILES = 'SupportingFiles';
    settings.folderNames.SUBMISSION_ATTACHMENTS = 'Submission attachment(s)';
    settings.folderNames.FEEDBACK_ATTACHMENTS = 'Feedback Attachment(s)';

    % This is howw long to wait (in seconds) before terminating the
    % student test case
    settings.TIMEOUT_LENIENCY = 30;

    settings.images.RED_CROSS = '<span style="color:green;">&#10004;</span>'; %'<img alt="cross.png" style="width:12px;height:12px" src="data:image/png;base64," />';
    settings.images.GRN_CHECK = '<span style="color: red">&#10006;</span>'; %'<img alt="check.png" style="width:12px;height:12px" src="data:image/png;base64," />';
end